text:
@ulrikkehoyer was in japan awaiting to walk a louis vuitton show when she was deemed to have a â€˜very bloated stomachâ€™, â€˜bloated faceâ€™ and told to â€˜only drink water for the next 24 hoursâ€™ by the casting director alexia for ashley brakow. at breakfast, starving, ulrikke ate the minimum before her plate was taken away as alexia checked if she had eaten. 10 hours later alexia was called by her agency in denmark who informed her she was cancelled from the show she was currently awaiting to walk and being sent home across the world. 
this story is sadly just part of many modelâ€™s realities. being â€˜optionedâ€™ for exclusive shows at fashion week, meaning they are held back from all other shows, only to have it dropped. being confirmed for jobs to have them cancelled even on the day, often with no cancellation fee payable - whereas if the model were even to be sick too attend work they could be sued for the production costs without a valid medical certificate. they donâ€™t get to choose holidays and take sick days as â€˜self employed workersâ€™ because they donâ€™t have any. the imbalance of power is real, and it is grossly unjust. 
show your support for â€˜bloatedâ€™ @ulrikkehoyer by signing the petition to stop this from being such an accepted part of the industry.

